import React from 'react';

export class Login extends React.Component
{
    constructor(props) {
        super(props);

        this.state =
            {
                email: '',
                password: ''
            }
    }
    handleInputChange = (event) =>
    {
        this.setState(
            {

                [event.target.name]: event.target.value
            })

    }

    submitHandler = (event) =>
    {
        const data = this.state;

        /*
        axios.post('http://172.116.201.31:8080/adduser',data)
            .then(resp => console.log(resp));
        */

        /*
        // Simple POST request with a JSON body using fetch
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ data })
        };
        fetch('http://172.116.201.31:8080/adduser', requestOptions)
            .then(response => console.log(response))
            .then(data => this.setState({ postId: data.id }));
        */
        alert(`Test Variables
               --------------
                  Email: ${this.state.email} 
               Password: ${this.state.password}
             Repassword: ${this.state.repassword}
              FirstName: ${this.state.firstName}
               LastName: ${this.state.lastName}
                    NPI: ${this.state.npi}
             Speciality: ${this.state.speciality}
                Address: ${this.state.address}
                   City: ${this.state.city}
               US_State: ${this.state.us_state}
                    Zip: ${this.state.zip}
                Picture: ${this.state.picture}
                    Bio: ${this.state.bio}
                    
                    
                    xxxxxxxxxxxxxxxxxxxxxxxx
                    
                    
                  Email: ${data.email} 
               Password: ${data.password}
             Repassword: ${data.repassword}
              FirstName: ${data.firstName}
               LastName: ${data.lastName}
                    NPI: ${data.npi}
             Speciality: ${data.speciality}
                Address: ${data.address}
                   City: ${data.city}
               US_State: ${data.us_state}
                    Zip: ${data.zip}
                Picture: ${data.picture}
                    Bio: ${data.bio}`
        );


        event.preventDefault();
    }
    render() {
        return(
            <div>
                <h1>Login</h1>
                <form onSubmit={this.submitHandler}>
                    <label>
                        Email:
                        <input
                            name="email"
                            type="text"
                            value={this.state.email}
                            onChange={this.handleInputChange}
                            required/>
                    </label>
                    <br />
                    <label>
                        Password:
                        <input
                            name="password"
                            type="text"
                            value={this.state.password}
                            onChange={this.handleInputChange}
                            required/>
                    </label>
                    <button type="submit" value={this.state.value}>Login</button>
                </form>
            </div>
        );
    }

}
